function loadUrl(url, callback) {
    var xml = new XMLHttpRequest();
    xml.onreadystatechange = () => {
        if (xml.readyState == 4 && xml.status == 200) {
            callback(xml.responseText);
        }
    }
    xml.open("GET", url, true);
    xml.send(null);
}

